import 'package:chatbase_app/Screens/Profile_Screen/Components/profile_screen_list_item.dart';
import 'package:flutter/material.dart';

class ShowSheets extends StatefulWidget {
  const ShowSheets({Key? key}) : super(key: key);

  @override
  State<ShowSheets> createState() => _ShowSheetsState();
}

class _ShowSheetsState extends State<ShowSheets> {
  static List<ProfileScreenListItem> profileScreenListItem = [
    ProfileScreenListItem(
        title: "Edit Profile", icon: Icons.person_rounded, color: Colors.pink),
    ProfileScreenListItem(
        title: "Chats",
        icon: Icons.chat_bubble_rounded,
        color: Colors.deepOrange),
    ProfileScreenListItem(
        title: "Subscriptions", icon: Icons.pix_rounded, color: Colors.amber),
    ProfileScreenListItem(
        title: "Account Settings",
        icon: Icons.manage_accounts_rounded,
        color: Colors.green),
    ProfileScreenListItem(
        title: "Privacy Settings",
        icon: Icons.shield_rounded,
        color: Colors.teal),
    ProfileScreenListItem(
        title: "Settings", icon: Icons.settings_rounded, color: Colors.purple),
    ProfileScreenListItem(
        title: "Help", icon: Icons.help_rounded, color: Colors.blue),
    ProfileScreenListItem(
        title: "Tell a Friend",
        icon: Icons.person_add_alt_rounded,
        color: Colors.red),
  ];

  @override
  Widget build(BuildContext context) {
    Size size = MediaQuery.of(context).size;
    return Container(
      width: double.infinity,
      height: size.height / 2,
      clipBehavior: Clip.antiAliasWithSaveLayer,
      decoration: const BoxDecoration(
        color: Colors.white,
        borderRadius: BorderRadius.vertical(
          top: Radius.circular(29.0),
        ),
        boxShadow: [
          BoxShadow(
            blurRadius: 6.0,
            spreadRadius: 0.0,
            color: Colors.black38,
          ),
        ],
      ),
      child: SizedBox(
        child: ListView.builder(
          itemCount: profileScreenListItem.length,
          shrinkWrap: true,
          physics: const BouncingScrollPhysics(),
          padding: const EdgeInsets.only(left: 16.0, right: 16.0, bottom: 16.0),
          itemBuilder: ((context, index) {
            return Padding(
              padding: const EdgeInsets.only(top: 16.0),
              child: ListTile(
                leading: Container(
                  height: 45.0,
                  width: 45.0,
                  decoration: BoxDecoration(
                    borderRadius: BorderRadius.circular(29.0),
                    color: profileScreenListItem[index].color!.shade50,
                  ),
                  child: Icon(
                    profileScreenListItem[index].icon,
                    size: 24.0,
                    color: profileScreenListItem[index].color!.shade400,
                  ),
                ),
                title: Text(profileScreenListItem[index].title!),
                minVerticalPadding: 0.0,
                contentPadding: const EdgeInsets.all(0.0),
                trailing: Icon(
                  Icons.arrow_forward_ios_rounded,
                  size: 20.0,
                  color: Colors.grey.shade400,
                ),
                onTap: () {
                  // ignore: avoid_print
                  print(profileScreenListItem[index].title!);
                },
              ),
            );
          }),
        ),
      ),
    );
  }
}
